import React, { Fragment, useState } from "react";
import "./List.css";

function List({ data }) {
  const [expandedIndex, setExpand] = useState(-1);

  const handleListExpand = (index) => {
    console.log(index);
    setExpand(index);
    return <List data={data[index]} />;
  };

  return (
    <div className="list__container">
      <ul className="list__items">
        {data &&
          data.map((d, index) => {
            return (
              <Fragment key={index}>
                <li
                  className="list__item"
                  onClick={() => handleListExpand(index)}
                >
                  {d.title}
                </li>
              </Fragment>
            );
          })}
      </ul>
    </div>
  );
}

export default List;
